UPDATE tour t
JOIN (
    SELECT 
        t.id AS tour_id,
        COALESCE(SUM(CASE WHEN l.location_type = 'AIR' THEN sc.price END), 0) AS air_price_sum,
        COALESCE(SUM(CASE WHEN l.location_type = 'HOTEL' THEN h.price END), 0) AS hotel_price_sum
    FROM tour t
    LEFT JOIN schedule s 
        ON s.tour_id = t.id
    LEFT JOIN location l 
        ON l.schedule_id = s.id
    LEFT JOIN seat_class sc 
        ON l.seat_class_id = sc.id
    LEFT JOIN hotel h 
        ON l.hotel_id = h.id
    GROUP BY t.id
) x ON t.id = x.tour_id
SET t.air_price_sum= x.air_price_sum,
    t.hotel_price_sum = x.hotel_price_sum;



